import { useForm } from "react-hook-form";
import "./BuyMovie.css";
import BuyModel from "../../../Models/buy-model";
import notify from "../../../Utils/Notify";
import moviesService from "../../../Services/movies-service";

function BuyMovie(): JSX.Element {

    const{register,handleSubmit} = useForm<BuyModel>();

    async function send(buy:BuyModel) {
        try{

            await moviesService.buyMovie(buy)
            notify.success("")
        }catch(err:any){
           notify.error(err) 
        }
    }    

    return (
        <div className="BuyMovie">
			<h1>buy movie</h1>
        </div>
    );
}

export default BuyMovie;
